'use strict';

// Complete the steadyGene function below.
const getBalance = (gene) => {
    /* This function checks the gene string balance, i.e. The number of times that a characters comes up */
    let l = gene.length;
    let balance = {'A': 0, 'C': 0, 'G': 0, 'T':0};
    for (let i = 0; i < l; i++) {
        let c = gene[i];
        ++balance[c];	
    }
    return balance;
};

const getBreakingChars = (balance, optimal) => {
    /*Hints the solution by highlighting the unbalance*/
  let max = 0;
  let chars = {};
  Object.keys(balance).forEach( c => {
    let unbalance = balance[c] - optimal;
    if (unbalance > 0) {
        max += unbalance;
        chars[c] = unbalance;
    }
	});
  return [max, chars];
};

const reduceLeft = (substring, targets) => {
  let i = 0;
  while (i < substring.length && targets.indexOf(substring[i]) === -1) {
      i++;
  }
  return i;
};

const reduceRight = (substr, targets) => {
    let j = substr.length - 1;
    let discount = 0;
    while (j > 0 && targets.indexOf(substr[j]) === -1) {
        discount++;
        j--;
    }
    return discount;
};

const countTargets = (substring, targets) => {
    let count = {'A': 0, 'C': 0, 'G': 0, 'T': 0};
  for (let i = 0; i < substring.length; i++) {
      if (targets.indexOf(substring[i]) !== -1)
        ++count[substring[i]];
  }
  return count;
};

const holdsProperty = (counts, chars) => {
    if (chars['A'] !== undefined && chars['A'] < counts['A']) return false;
    if (chars['C'] !== undefined && chars['C'] < counts['C']) return false;
    if (chars['G'] !== undefined && chars['G'] < counts['G']) return false;
    if (chars['T'] !== undefined && chars['T'] < counts['T']) return false;

    return true;
};

const isSolution = (counts, chars) => {
    if (chars['A'] !== undefined && chars['A'] !== counts['A']) return false;
    if (chars['C'] !== undefined && chars['C'] !== counts['C']) return false;
    if (chars['G'] !== undefined && chars['G'] !== counts['G']) return false;
    if (chars['T'] !== undefined && chars['T'] !== counts['T']) return false;

    return true;
};

function steadyGene(gene) {
  let optimal = gene.length / 4;
  let balance = getBalance(gene);
  let breakingChars = getBreakingChars(balance, optimal);    
  //console.log("Solution contains: ", breakingChars);
  let min = breakingChars[0];
  let chars = breakingChars[1];
  let targets = Object.keys(chars);
  if (min > 0) {
    let minSubsize = gene.length;
    let i = 0;
    let j = min;
      let substr = gene.substring(i, j);
      let counts = countTargets(substr, targets);
    while (j < gene.length - 1) {
      console.log("Entered with: ", substr);
      console.log(counts);
      let holdsProp = holdsProperty(counts, chars);
          while (holdsProp) {
              let toAdd = gene[j];
              console.log("To Add: ", toAdd);
              console.log("J++: ", j);
              if (targets.indexOf(toAdd) !== -1) ++counts[toAdd];
              holdsProp = holdsProperty(counts, chars);
              if (!holdsProp) break;
              j++;
          }
        let toRemove = gene[i];
          i++;
          //console.log("To remove: ", toRemove);
          if (targets.indexOf(toRemove) !== -1) --counts[toRemove];
          substr = gene.substring(i, j);
          let left = reduceLeft(substr, targets);
          i += left;
          //console.log("Left: ", left);
          let right = reduceRight(substr, targets);
          substr = gene.substring(i, j - right);
          //counts = countTargets(substr, targets);
          console.log("Substring: ", substr);
          console.log(counts);
          if (isSolution(counts, chars) && (substr.length < minSubsize)) {
              minSubsize = substr.length;
              //console.log("Current best: ", substr);
              //console.log("Min: ", minSubsize);
              if (minSubsize === min) {
                  return min;
              }
          }
          j += left;

    }
    return minSubsize;
  }
  return 0;
}

function main() {
  const gene = "TGATGCCGTCCCCTCAACTTGAGTGCTCCTAATGCGTTGC";
  //const gene = "";
     //const gene = "GAAATAAA";
    //const gene = "";
  //const gene = "";
    let result = steadyGene(gene);
  console.log(result);
}

main();